import React from 'react';

const NestedList = ({ data }) => {
  const renderList = (items) => {
    return (
      <ul>
        {items.map((item, index) => (
          <li key={index}>
            {typeof item === 'object' ? <NestedList data={item} /> : item}
          </li>
        ))}
      </ul>
    );
  };

  return <div>{renderList(data)}</div>;
};

export default NestedList;
